    // ---------------------------------------------------------------------
    //  M√≥dulo: Normalizaci√≥n de teclas y combos
    // ---------------------------------------------------------------------
    const KeyUtils = (function () {
        const ARROW_MAP = {
            ArrowUp: 'UP',
            ArrowDown: 'DOWN',
            ArrowLeft: 'LEFT',
            ArrowRight: 'RIGHT'
        };
        const ARROW_NORMALIZED_MAP = {
            ARROWUP: 'UP',
            ARROWDOWN: 'DOWN',
            ARROWLEFT: 'LEFT',
            ARROWRIGHT: 'RIGHT',
            UP: 'UP',
            DOWN: 'DOWN',
            LEFT: 'LEFT',
            RIGHT: 'RIGHT'
        };
        const SHIFTED_DIGIT_MAP = {
            '!': '1',
            '@': '2',
            '#': '3',
            '$': '4',
            '%': '5',
            '^': '6',
            '&': '7',
            '*': '8',
            '(': '9',
            ')': '0'
        };

        /**************************************************************************
        //Nombre: normalizeComboFromEvent
        //Fecha modificaci√≥n: 2025-11-15
        //Hora: 11:30
        //Autor: mincho77
        //Entradas: evt (KeyboardEvent)
        //Salidas: string con el combo normalizado o null si no aplica
        //Prerrequisitos si existen: Evento de teclado v√°lido
        //Descripci√≥n: Convierte un KeyboardEvent en una cadena tipo
        //             "ALT+SHIFT+Z" o "UP". Ignora eventos repetidos.
        **************************************************************************/
        function normalizeComboFromEvent(evt, options) {
            if (!evt || evt.repeat) {
                return null;
            }

            // Evitar capturar ShortCuts cuando el usuario est√° escribiendo
            const opts = options || {};
            const allowEditableTargets = !!opts.allowEditableTargets;
            if (!allowEditableTargets) {
                const target = evt.target;
                if (target) {
                    const tagName = (target.tagName || '').toLowerCase();
                    const isEditable = target.isContentEditable;
                    if (tagName === 'input' || tagName === 'textarea' || isEditable) {
                        return null;
                    }
                }
            }

            const parts = [];
            if (evt.ctrlKey) {
                parts.push('CTRL');
            }
            if (evt.altKey) {
                parts.push('ALT');
            }
            if (evt.shiftKey) {
                parts.push('SHIFT');
            }
            if (evt.metaKey) {
                parts.push('CMD');
            }

            let key = evt.key;
            if (!key) {
                return null;
            }

            if (ARROW_MAP[key]) {
                key = ARROW_MAP[key];
            } else if (key.length === 1) {
                // Si es un s√≠mbolo de n√∫mero con SHIFT (por ejemplo !, @, #),
                // lo mapeamos al d√≠gito correspondiente para combos tipo CTRL+SHIFT+1
                if (evt.shiftKey && SHIFTED_DIGIT_MAP[key]) {
                    key = SHIFTED_DIGIT_MAP[key];
                } else {
                    key = key.toUpperCase();
                }
            } else {
                // Normalizar algunos casos especiales si fueran necesarios
                key = key.toUpperCase();
            }

            parts.push(key);
            return parts.join('+');
        }

        function normalizeComboString(comboText) {
            if (!comboText) {
                return '';
            }

            const rawParts = comboText.split('+');
            const modifierFlags = {
                CTRL: false,
                ALT: false,
                SHIFT: false,
                CMD: false
            };
            let keyPart = '';

            rawParts.forEach(function (part) {
                const trimmed = part.trim();
                if (!trimmed) {
                    return;
                }
                const upper = trimmed.toUpperCase();
                if (upper === 'CTRL' || upper === 'CONTROL' || upper === 'STRG') {
                    modifierFlags.CTRL = true;
                    return;
                }
                if (upper === 'ALT' || upper === 'OPTION') {
                    modifierFlags.ALT = true;
                    return;
                }
                if (upper === 'SHIFT') {
                    modifierFlags.SHIFT = true;
                    return;
                }
                if (upper === 'CMD' || upper === 'COMMAND' || upper === 'META') {
                    modifierFlags.CMD = true;
                    return;
                }

                if (ARROW_NORMALIZED_MAP[upper]) {
                    keyPart = ARROW_NORMALIZED_MAP[upper];
                    return;
                }

                keyPart = upper.length === 1 ? upper : upper;
            });

            const ordered = [];
            if (modifierFlags.CTRL) {
                ordered.push('CTRL');
            }
            if (modifierFlags.ALT) {
                ordered.push('ALT');
            }
            if (modifierFlags.SHIFT) {
                ordered.push('SHIFT');
            }
            if (modifierFlags.CMD) {
                ordered.push('CMD');
            }
            if (keyPart) {
                ordered.push(keyPart);
            }

            return ordered.join('+');
        }

        return {
            normalizeComboFromEvent,
            normalizeComboString
        };
    })();

